import React from 'react';
import { Container, Grid, Card, CardContent, Typography, Button, Box, Avatar, AppBar, Toolbar } from '@mui/material';
import { createTheme, ThemeProvider } from '@mui/material/styles';

const theme = createTheme({
  palette: {
    primary: {
      main: '#1976d2', // Blue color for navbar and footer
    },
    secondary: {
      main: '#ff4081',
    },
  },
});

function App() {
  const linkCategories = [
    {
      title: 'Social Links',
      links: [
        { name: 'GitHub', url: 'https://github.com' },
        { name: 'LinkedIn', url: 'https://linkedin.com' },
        { name: 'Twitter', url: 'https://twitter.com' },
        { name: 'Instagram', url: 'https://instagram.com' },
        { name: 'Facebook', url: 'https://facebook.com' },
      ],
    },
    {
      title: 'Educational Links',
      links: [
        { name: 'Coursera', url: 'https://coursera.org' },
        { name: 'edX', url: 'https://edx.org' },
        { name: 'Udemy', url: 'https://udemy.com' },
        { name: 'Khan Academy', url: 'https://khanacademy.org' },
        { name: 'Codecademy', url: 'https://codecademy.com' },
      ],
    },
    {
      title: 'Entertainment Links',
      links: [
        { name: 'Netflix', url: 'https://netflix.com' },
        { name: 'YouTube', url: 'https://youtube.com' },
        { name: 'Spotify', url: 'https://spotify.com' },
        { name: 'Hulu', url: 'https://hulu.com' },
        { name: 'Disney+', url: 'https://disneyplus.com' },
      ],
    },
  ];
  const popularPortals = [
    { name: 'Google', url: 'https://google.com' },
    { name: 'Amazon', url: 'https://amazon.com' },
    { name: 'Microsoft', url: 'https://microsoft.com' },
    { name: 'Apple', url: 'https://apple.com' },
    { name: 'Netflix', url: 'https://netflix.com' },
  ];


  return (
    <ThemeProvider theme={theme}>
      <div className="background" style={{ backgroundColor: '#15292B', minHeight: '100vh' }}>
        {/* Navbar */}
        <AppBar position="static" sx={{ backgroundColor: '#1976d2' }}>
          <Toolbar>
            <Avatar
              alt="Logo"
              src="/path/to/your-logo.jpg"
              sx={{ marginRight: 2, width: 50, height: 50 }}
            />
            <Typography variant="h6" component="div" sx={{ flexGrow: 1 }}>
              Your Website
            </Typography>
          </Toolbar>
        </AppBar>

        {/* Main Content */}
        <Container
          // maxWidth="lg"
          sx={{
            backgroundColor: 'rgba(255, 255, 255, 0.01)', // Slightly transparent background
            borderRadius: '10px',
            padding: '30px',
            marginTop: '50px',
            maxWidth: '100vw'
          }}
        >
          {/* Popular Portals Section */}
          <Box sx={{ marginBottom: '30px',marginLeft:'7vw' }}>
            <Typography variant="h5" gutterBottom sx={{ textAlign: 'center', marginBottom: '20px' }}>
              Popular Portals
            </Typography>
            <Grid container spacing={2}>
              {popularPortals.map((portal, index) => (
                <Grid item xs={12} sm={2} key={index}>
                  <Card
                    sx={{
                      backgroundColor: 'rgba(255, 255, 255, 0.3)', // Transparent card
                      boxShadow: '0 4px 8px rgba(0, 0, 0, 0.2)',
                      borderRadius: '10px',
                      border: '1px solid rgba(255, 255, 255, 0.5)',
                      textAlign: 'center',
                      padding: '20px',
                      position: 'center',
                      marginLeft: '2vw',
                    }}
                  >
                    <CardContent>
                      <Button
                        variant="contained"
                        color="primary"
                        href={portal.url}
                        target="_blank"
                        fullWidth
                        sx={{
                          padding: '10px',
                          color: 'white',
                          backgroundColor: '#1976d2',
                          '&:hover': {
                            backgroundColor: '#155a8a', // Darker shade of blue for hover
                          },
                        }}
                      >
                        {portal.name}
                      </Button>
                    </CardContent>
                  </Card>
                </Grid>
              ))}
            </Grid>
          </Box>

          <Grid container spacing={3} sx={{ borderSpacing: '20px' }}>
            {linkCategories.map((category, index) => (
              <Grid item xs={12} sm={4} key={index} sx={{ padding: '0 10px' }}>
                <Card
                  sx={{
                    backgroundColor: 'rgba(255, 255, 255, 0.1)', // Transparent card
                    boxShadow: 'none',
                    borderRadius: '10px',
                    border: '1px solid rgba(255, 255, 255, 0.3)',
                    textAlign: 'center',
                    padding: '20px', // Padding inside the card
                  }}
                >
                  <CardContent>
                    <Typography variant="h6" gutterBottom>
                      {category.title}
                    </Typography>
                    {category.links.map((link, i) => (
                      <Box key={i} sx={{ margin: '10px 0' }}>
                        <Button
                          variant="contained"
                          color="primary"
                          href={link.url}
                          target="_blank"
                          fullWidth
                          sx={{
                            padding: '10px',
                            color: 'white',
                            backgroundColor: '#1976d2',
                            '&:hover': {
                              backgroundColor: '#155a8a', // Darker shade of blue for hover
                            },
                          }}
                        >
                          {link.name}
                        </Button>
                      </Box>
                    ))}
                  </CardContent>
                </Card>
              </Grid>
            ))}
          </Grid>
        </Container>

        {/* Footer */}
        <Box
          sx={{
            backgroundColor: '#1976d2',
            color: 'white',
            padding: '10px 0',
            textAlign: 'center',
            marginTop: '50px',
            position: 'relative',
            bottom: 0,
            width: '100%',
          }}
        >
          <Typography variant="body1">
            © 2024 Your Website. All rights reserved.
          </Typography>
        </Box>
      </div>
    </ThemeProvider>
  );
}

export default App;
